import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";
import {Container, Row, Col} from "react-bootstrap";
import Button from "react-bootstrap/Button";
import Modal from "react-bootstrap/Modal"


export const Services = () => {
    const responsive = {
        superLargeDesktop: {
            breakpoint: {max: 4000, min: 3000},
            items: 5
        },
        desktop: {
            breakpoint: {max: 3000, min: 1024},
            items: 3
        },
        tablet: {
            breakpoint: {max: 1024, min: 464},
            items: 2
        },
        mobile: {
            breakpoint: {max: 464, min: 0},
            items: 1
        }
    };

    return(
        <section classname="service" id= "services">
            <Container>
                <Row>
                    <Col>
                    <div className="service-bx">
                        <h2>
                            Core Services
                        </h2>
                        <Carousel responsive={responsive} infinite={true} className="service-slider">
                            <div className="item">
                                <button className="serviceButton">Individual Therapy</button>
                            </div>
                            <div className="item">
                                <button className="serviceButton">Group Therapy</button>
                            </div>
                            <div className="item">
                                <button className="serviceButton">Family Therapy</button>
                            </div>
                            <div className="item">
                                <button className="serviceButton">Couples Therapy</button>
                            </div>
                            <div className="item">
                                <button className="serviceButton">Grief and Loss</button>
                            </div>
                            <div className="item">
                                <button>Teens Counselling</button>
                            </div>
                        </Carousel>
                    </div>
                    </Col>
                </Row>
            </Container>
        </section>
    )
}
